import React from 'react'
import Product from './Product'

function Frames() {
    return (
        <div className='store__frames'>

                    <Product
                        id='17'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={24}
                        availble={true}
                    />  
                    <Product
                        id='18'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={19}
                        availble={false}
                    /> 
           

              
                    <Product
                        id='19'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={77}
                        availble={false}
                    />
                    <Product
                        id='20'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={1}
                        availble={false}
                    /> 
              

             
                    <Product
                        id='21'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={75}
                        availble={false}
                    />
                    <Product
                        id='22'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={75}
                        availble={false}
                    /> 
             

               
                    <Product
                        id='23'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={75}
                        availble={false}
                    />
                    <Product
                        id='24'
                        title='BetterComb Deep Frame 10 Pack'
                        image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                        price={75}
                        availble={false}
                    />  
                
        </div>
    )
}

export default Frames
